import React from "react";
import {
  ArtworkArt,
  ArtworkContainer,
  ArtworkFrame,
  ArtworkImg,
  ArtworkMat,
} from "./ArtworkElms";
import JS from "../../images/js.png";

const Artworks = () => {
  return (
    <ArtworkContainer>
      <ArtworkFrame>
        <ArtworkArt>
          <ArtworkImg src={JS} type="image/png" />
        </ArtworkArt>
      </ArtworkFrame>
    </ArtworkContainer>
  );
};

export default Artworks;
